import { View, Text, StyleSheet } from 'react-native';
import * as Animatable from 'react-native-animatable';
import { useFonts } from 'expo-font';
import Illustration_13 from '../../../../assets/images/js/Illustration_13.js';
import cardStyles from '../cardStyles';

const styles = cardStyles;

export const CardSessionStat = () => {
  const [loaded] = useFonts({
    ObjektivRegular: require('./../../../../assets/fonts/ObjektivMk2-Regular.ttf'),
    ObjektivBold: require('./../../../../assets/fonts/ObjektivMk2-Bold.ttf'),
  });

  if (!loaded) {
    return null;
  }
  return (
    <View style={styles.cardWrapperTall}>
      <View style={styles.cardInner}>
        <Animatable.View
          animation="fadeIn"
          delay={Animations.SPEED_MED}
          duration={Animations.SPEED_XSLOW}
          style={styles.imageWrapper}
        >
          <Illustration_13 style={styles.image} />
        </Animatable.View>
        <Animatable.Text
          animation="fadeInUp"
          delay={Animations.SPEED_MED}
          duration={Animations.SPEED_SLOW}
          style={styles.description}
        >
          Your last session appeared to have helped you offset tremor.
        </Animatable.Text>

        <View style={localStyles.sessionStatWrapper}>
          <Animatable.View
            animation="fadeInLeft"
            delay={1000}
            duration={500}
            style={localStyles.sessionStat}
          >
            <Text style={localStyles.sessionValue}>9:25am</Text>
            <Text style={localStyles.sessionLabel}>Session start time</Text>
          </Animatable.View>
          <Animatable.View
            animation="fadeIn"
            delay={1700}
            duration={300}
            style={localStyles.divider}
          />
          <Animatable.View
            animation="fadeInRight"
            delay={1300}
            duration={500}
            style={localStyles.sessionStat}
          >
            <Text style={localStyles.sessionValue}>32min</Text>
            <Text style={localStyles.sessionLabel}>Total session duration</Text>
          </Animatable.View>
        </View>
      </View>
    </View>
  );
};

const localStyles = StyleSheet.create({
  sessionStatWrapper: {
    display: 'flex',
    flexDirection: 'row',
    height: 84,
    width: 'auto',
    // minWidth: 250,
    marginTop: 20,
  },
  divider: {
    height: 84,
    width: 1,
    backgroundColor: '#bbb',
  },
  sessionStat: {
    justifyContent: 'center',
    alignItems: 'center',
    height: 84,
    width: '50%',
    textAlign: 'center',
    paddingHorizontal: 20,
  },
  sessionValue: {
    fontFamily: Fonts.FONT_FACE_TITLE,
        fontSize: Fonts.FONT_SIZE_TITLE,
    marginBottom: 6,
  },
  sessionLabel: {
    fontFamily: Fonts.FONT_FACE_DESCRIPTION,
    fontSize: Fonts.FONT_SIZE_DESCRIPTION,
    textAlign: 'center',
    lineHeight: 24,
  },
});
